import React, {Component} from 'react';
import Form from "react-bootstrap/Form";
import Button from "react-bootstrap/Button";
import "./Login.css";
import NotLoggedInMenu from "./NotLoggedInMenu";
class Login extends Component {
    handleLogin = (event) => {
        event.preventDefault();
        console.log(event.username.value);
    };
    render() {
        return (
            <div>
                <NotLoggedInMenu activeSite={"#"}/>
                <div className="initial-form">
                    <Form onSubmit={this.handleLogin}>
                        <Form.Group controlId="formBasicEmail">
                            <Form.Label size="lg">Username</Form.Label>
                            <Form.Control type="username" placeholder="Enter username" size="lg" />
                        </Form.Group>
                        <Form.Group controlId="formBasicPassword">
                            <Form.Label>Password</Form.Label>
                            <Form.Control type="password" placeholder="Password" size="lg" />
                        </Form.Group>
                        <Button variant="primary" type="submit" size="lg" block>
                            Log me In
                        </Button>
                        <Button variant="primary" type="submit" size="lg" block>
                            Sign Up
                        </Button>
                    </Form>
                </div>
            </div>
        );
    }
}

export default Login;
